import React, { useState } from 'react'

import Header from '../../components/header/Header'
import ProjectManager from '../../components/code/ProjectManager'
import SourceCode from '../../components/code/SourceCode'

import styles from './Project.module.css'
import { useDispatch, useSelector } from 'react-redux'

const Code = () => {
    const dispatch = useDispatch()
    const {code} = useSelector(state=>state)

    const tabList = [
        <ProjectManager/>,
        <SourceCode/>
    ]
    
    const goFirstTab = () => {
        dispatch({type: 'SET_FIRST_TAB', payload: true});
    }

    const goSecondTab = () => {
        dispatch({type: 'SET_FIRST_TAB', payload: false});
    }

    return (
        <>
            <Header/>
            <div className={styles.container}>
                <div>
                    <div className={styles.navigation}>
